import React from 'react'
import { useHistory } from 'react-router-dom';
import {
    Section,
    Header,
    RepoNumber,
    Button,
    Title,
    Description,
    RepoContainer,
    Icons,
    StarNumber,
    Div

} from './styles'

import { BiStar } from "react-icons/bi"
import { BiArrowBack } from "react-icons/bi";
import { BiHomeAlt } from "react-icons/bi";
import { BiGitBranch } from "react-icons/bi";
import { BiCool } from "react-icons/bi";

const ReposPage = (props) => {
        const history = useHistory()

    return (
        <Section>
            <Header>
                <div><Button onClick={()=>history.push('/Home')}><BiArrowBack size={20} /> </Button></div> 
                <RepoNumber>{props.number} repositórios</RepoNumber>
            </Header>
                {(props.repos).map(repo =>(
                        <RepoContainer key={repo.id}>
                            <Title>{repo.name}</Title>
                            <Description>{repo.description}</Description>
                            <Icons>
                            <BiStar size={15} /> <StarNumber>{repo.stargazers_count}</StarNumber>
                            </Icons>
                            <Div></Div>
                        </RepoContainer>
                ))}
            </Section>
    )
}

export default ReposPage
